import java.util.*;
import java.io.*;

public class ModifiedSubsequenceSum {
    static long[][] lines = null;
    static int start = 0, end = 0;

    static long modifiedSubsequenceSum(int n, int k, long[] a) {
        lines = new long[n][];
        start = 0;
        end = 0;
        long[][] dp = new long[n + 1][2];
        // init dp. Init dp[0][0] to Long.MIN_VALUE so that the output won't be 0 if every element in a <= 0
        dp[0] = new long[]{Long.MIN_VALUE, a[0]};
        // init lines
        // line function: yj(x) = 2k(j+1) * x - k(j+1)^2 + dp[j][1]
        lines[0] = new long[]{2 * k, -k + a[0]};
        for (int i = 1; i < n; i++) {
            dp[i][0] = Math.max(dp[i - 1][0], dp[i - 1][1]);

            dp[i][1] = Math.max(a[i], query(i) + a[i] - k * (long) i * (long) i);
            add(2l * k * (i + 1), -k * (long) (i + 1) * (i + 1) + dp[i][1]);
        }

        return Math.max(dp[n - 1][0], dp[n - 1][1]);
    }

    static long query(int i) {
        while (start < end && lines[start][0] * i + lines[start][1] < lines[start + 1][0] * i + lines[start + 1][1])
            start++;
        return lines[start][0] * i + lines[start][1];
    }

    static void add(long m, long c) {
        long[] pair = {m, c};
        while (end > start && isBad(lines[end - 1], lines[end], pair)) {
            end--;
        }
        lines[++end] = pair;
    }

    static boolean isBad(long[] a, long[] b, long[] c) {
        return (a[1] - b[1]) * (c[0] - b[0]) > (b[1] - c[1]) * (b[0] - a[0]);
    }

    static void go() {
        int n = in.nextInt();
        int k = in.nextInt();
        long[] a = in.nextLongArray(n);
        out.println(modifiedSubsequenceSum(n, k, a));
    }

    static InputReader in;
    static PrintWriter out;

    public static void main(String[] args) {
        in = new InputReader(System.in);
        out = new PrintWriter(System.out);

        go();

        out.close();
    }

    static class InputReader {
        private InputStream stream;
        private byte[] buf = new byte[1024];
        private int curChar;
        private int numChars;

        public InputReader(InputStream stream) {
            this.stream = stream;
        }

        public int read() {
            if (numChars == -1)
                throw new InputMismatchException();
            if (curChar >= numChars) {
                curChar = 0;
                try {
                    numChars = stream.read(buf);
                } catch (IOException e) {
                    throw new InputMismatchException();
                }
                if (numChars <= 0)
                    return -1;
            }
            return buf[curChar++];
        }

        public int[] nextIntArray(int len) {
            int[] ret = new int[len];
            for (int i = 0; i < len; i++)
                ret[i] = nextInt();
            return ret;
        }

        public long[] nextLongArray(int len) {
            long[] ret = new long[len];
            for (int i = 0; i < len; i++)
                ret[i] = nextLong();
            return ret;
        }


        public int nextInt() {
            return (int) nextLong();
        }

        public long nextLong() {
            int c = read();
            while (isSpaceChar(c))
                c = read();
            int sgn = 1;
            if (c == '-') {
                sgn = -1;
                c = read();
            }
            long res = 0;
            do {
                if (c < '0' || c > '9')
                    throw new InputMismatchException();
                res *= 10;
                res += c - '0';
                c = read();
            } while (!isSpaceChar(c));
            return res * sgn;
        }

        public String nextLine() {
            StringBuilder sb = new StringBuilder(1024);
            int c = read();
            while (!(c == '\n' || c == '\r' || c == -1)) {
                sb.append((char) c);
                c = read();
            }
            return sb.toString();
        }

        public char nextChar() {
            int c = read();
            while (isSpaceChar(c))
                c = read();
            return (char) c;
        }

        public String nextString() {
            int c = read();
            while (isSpaceChar(c))
                c = read();
            StringBuilder sb = new StringBuilder(1024);
            do {
                sb.append((char) c);
                c = read();
            } while (!isSpaceChar(c));
            return sb.toString();
        }

        public char[] nextCharArray(int n) {
            char[] ca = new char[n];
            for (int i = 0; i < n; i++) {
                int c = read();
                while (isSpaceChar(c))
                    c = read();
                ca[i] = (char) c;
            }
            return ca;
        }

        public static boolean isSpaceChar(int c) {
            switch (c) {
                case -1:
                case ' ':
                case '\n':
                case '\r':
                case '\t':
                    return true;
                default:
                    return false;
            }
        }
    }
}

